def training_loop(model, optimizer, n=1000):
    "Training loop for torch model."
    losses = []
    curr_fidelity=0
    
    while curr_fidelity<0.95:
        curr_fidelity = model()
        loss = (1-curr_fidelity)
        loss.backward()
        optimizer.step()
        optimizer.zero_grad()
        losses.append(loss.detach())  
        if len(losses)%10==0:
            print(len(losses),': curr_fidelity=',curr_fidelity)

    return losses



